INSERT INTO `comment` (`comment_id`, `c_user_id`, `c_thread_id`, `c_thread_user_id`, `c_main_category`, `c_sub_category`, `c_body`, `c_ip`, `c_privated`, `c_datetime`, `c_report_count`, `c_first_report_id`, `c_last_report_id`) VALUES(99, 4, 16, 6, 1, 0, '性おじ「なんだお前！？」\nサラA「オロナイン控えろ！」\n性おじ「なにすんだお前、流行らせコレ。」\nサラA「〆サバァ！」\n性おじ「なんだこいつら・・・。」\n性おじ「ドロヘドロ！（MPが足りない）」\nサラA「抵抗しても無駄だ！」\n性おじ「うざってぇ！お前らふたりなんかに負けるわけねーだろお前」\n性おじ「（ﾃﾚﾚﾚｰ↑）流行らせコラ！（ﾃﾚﾚﾚｰ↓）流行らせコラ！」\n性おじ「ムーミン野郎おいお前！流行らせコラ！」\n\n（４P乱入）\n\n性おじ「なんだお前！？（困惑）」\nサラB「３人に勝てるわけないだろ！」\n性おじ「馬.鹿野郎お前俺は勝つぞお前（天下無双）」\nサラA「フル焼きそば」\n性おじ「ゲホッゲホッ（大ダメージ）」\n性おじ「お前らの言うとおりになんかなんねーぞお前オラァ。離せゴラ」\n性おじ「ア゛（クルール）」\nサラA「シュバルゴ！」\n性おじ「ゲホッゲホッ（致命傷）」\nサラA「もう抵抗しても無駄だぞ」\n性おじ「嫉妬がぁ！」\nサラB「鼻くそが！（暴言）」\n性おじ「やめろォ！（建前）ナイスゥ！（本音）」\n性おじ「やめろお前、どこ触ってんでぃ！（江戸っ子）」\nサラA「見せてみろよオラァ！」\n性おじ「おともだちん.こ触って喜んでんじゃねーよお前」\nサラA「思ったとおりいい体してるじゃねーか」\n性おじ「やはりヤバイ（累計ダメージ）」', '126.7.197.134', 0, '2017-03-13 12:33:28', 0, NULL, NULL);
INSERT INTO `comment` (`comment_id`, `c_user_id`, `c_thread_id`, `c_thread_user_id`, `c_main_category`, `c_sub_category`, `c_body`, `c_ip`, `c_privated`, `c_datetime`, `c_report_count`, `c_first_report_id`, `c_last_report_id`) VALUES(100, 4, 16, 6, 1, 0, '性おじ「仮面ライダーなんだろお前は？」\nサラ「すいません！」\n性おじ「すいませんじゃ済まねーんだよお前」', '126.7.197.134', 0, '2017-03-13 12:42:23', 0, NULL, NULL);
